  /** 
  * Release all Oracle db resources that we know to be in use. 
  *  @return boolean <code>true</code> if we didn't encounter any problems, otherwise <code>false</code> 
  */ 
   
  public boolean releaseResources() 
    { 
    boolean returnCode = true; 
    
    theLog.debug("SynuserJobInvocationsMgr - Attempting to release connection");
    try 
      { 
      
      if (theSynuserJobInvocationsIns != null)
        { 
        theSynuserJobInvocationsIns.releaseResources(); 
        } 
      
      if (SynuserJobInvocationsUpd != null)
        { 
        SynuserJobInvocationsUpd.releaseResources(); 
        } 
      
      if (theSynuserJobInvocationsDel != null)
        { 
        theSynuserJobInvocationsDel.releaseResources(); 
        } 
      
      if (theSynJobDependenciesR81 != null)
        { 
        theSynJobDependenciesR81.releaseResources(); 
        } 
      
      if (theSynJobDependenciesR82 != null)
        { 
        theSynJobDependenciesR82.releaseResources(); 
        } 
      
      if (theSynJobDownloadTextR98 != null)
        { 
        theSynJobDownloadTextR98.releaseResources(); 
        } 
      
      if (theSynuserJobInvocationStepsR67 != null)
        { 
        theSynuserJobInvocationStepsR67.releaseResources(); 
        } 
      
      if (theSynuserJobOutputStateR44 != null)
        { 
        theSynuserJobOutputStateR44.releaseResources(); 
        } 
      
      if (theSynuserJobInvocationsJbinPkLck != null)
        { 
        theSynuserJobInvocationsJbinPkLck.releaseResources(); 
        } 
      
      if (theSynuserJobInvocationsJbinPk != null)
        { 
        theSynuserJobInvocationsJbinPk.releaseResources(); 
        } 
      
      if (theSynuserJobInvocationsR14 != null)
        { 
        theSynuserJobInvocationsR14.releaseResources(); 
        } 
      
      if (theSynuserJobInvocationsR43 != null)
        { 
        theSynuserJobInvocationsR43.releaseResources(); 
        } 
      
      if (theSynuserJobInvocationsR96 != null)
        { 
        theSynuserJobInvocationsR96.releaseResources(); 
        } 
      
      if (theSynuserJobInvocationsR97 != null)
        { 
        theSynuserJobInvocationsR97.releaseResources(); 
        } 
      } 
    catch (Exception e) 
      { 
      incErrorCount();
      theLog.warning(e.toString()); 
      returnCode = false; 
      } 
    
    theConnection = null; 
    incReleaseCount(); 
    theLog.debug("SynuserJobInvocationsMgr- Finished releasing connection");
    
    return(returnCode); 
    } 
  
